import React from 'react'

const signup2 = ({nextStep, handleChange}) => {

  const Continue = e => {
    e.preventDefault();
    nextStep();
  }

  const Previous = e => {
    e.preventDefault();
    nextStep();
  }

  return (
    <form onSubmit>
      <h3>Sign Up</h3>

      <div className="mb-3">
        <label>First name</label>
        <input
          type="text"
          className="form-control"
          placeholder="Text"
          // onChange={(e) => this.setState({ fname: e.target.value})}
          // required
        />
      </div>
    </form>
  )
}

export default signup2
